import { useEffect } from 'react';

export const useCache = () => {
    useEffect(() => {
        const pruebaDe = 'hola';
        localStorage.setItem('probemos', pruebaDe);
    }, [])
}

export const CacheContent = () => {
    console.log('hola');
}
